import shopStyles from "./Shop.module.css";
import data from "../../utils/data";
export default function Shop() {
  return (
    <div>
      <div className={shopStyles.cardBox}></div>
      {data.map((obj) => {
        if (obj.id === 1) {
          <Card props={obj}></Card>;
        }
      })}
      <img src=""></img>
    </div>
  );
}
